import React, { useState, useEffect, useCallback } from 'react';
import { Link } from 'react-router-dom';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');

  // Update Form States
  const [courseKey, setCourseKey] = useState('cyber'); 
  const [formData, setFormData] = useState({ instructor: '', videoLink: '' });

  // List States
  const [activeTab, setActiveTab] = useState('users');
  const [dataList, setDataList] = useState([]);
  const [loading, setLoading] = useState(false);

  const checkPass = () => {
    if (adminPass === "snx_admin_2026") setIsAdmin(true);
    else alert("Access Denied! ❌");
  };

  const fetchData = useCallback(async () => {
    setLoading(true);
    try {
      let query;
      if (activeTab === 'users') {
        query = new Parse.Query(Parse.User);
      } else {
        query = new Parse.Query("Enrollments");
        query.equalTo("status", activeTab);
      }
      query.descending("createdAt");
      const results = await query.find();
      setDataList([...results]); 
    } catch (error) {
      console.error("Fetch Error:", error);
    } finally {
      setLoading(false);
    }
  }, [activeTab]);

  useEffect(() => {
    if (isAdmin) fetchData();
  }, [isAdmin, activeTab, fetchData]);

  // အရေးကြီးဆုံးအပိုင်း: ဆရာနာမည်နှင့် Data များ Update လုပ်ရန်
  const handleUpdate = async (e) => {
    e.preventDefault();
    setLoading(true);

    // Database ထဲက 'Classes' ဆိုတဲ့ Table ထဲမှာ သွားရှာမယ်
    const ClassTable = Parse.Object.extend("Classes");
    const query = new Parse.Query(ClassTable);

    // courseId နဲ့ တိုက်စစ်မယ်
    query.equalTo("courseId", courseKey);

    try {
      let classObj = await query.first();

      if (!classObj) {
        // ❌ ရှာမတွေ့ရင် အသစ်တစ်ခု ဆောက်ပေးမယ်
        console.log("Creating new class entry...");
        classObj = new ClassTable();
        classObj.set("courseId", courseKey);

        // Course Title လှလှပပ ဖြစ်အောင် ပြင်မယ်
        const titles = {
          cyber: "Cyber Security",
          linux: "Linux Administrator",
          hacking: "World Hacking"
        };
        classObj.set("courseTitle", titles[courseKey]);
      }

      // ဆရာနာမည်နဲ့ ဗီဒီယို Link ကို ထည့်သွင်း/ပြင်ဆင်မယ်
      classObj.set("instructor", formData.instructor);
      classObj.set("videoLink", formData.videoLink);

      await classObj.save();
      alert(`Success: ${courseKey.toUpperCase()} Information Updated! ✅`);

      // Form ကို ရှင်းမယ်
      setFormData({ instructor: '', videoLink: '' });
    } catch (err) {
      alert("Error: " + err.message);
    } finally {
      setLoading(false);
    }
  };

  if (!isAdmin) return (
    <div style={styles.loginOverlay}>
      <h2 style={{color: '#00ff41'}}>[ ADMIN_LOGIN ]</h2>
      <input type="password" placeholder="KEY" onChange={e => setAdminPass(e.target.value)} style={styles.loginInput} />
      <button onClick={checkPass} style={styles.loginBtn}>ENTER</button>
    </div>
  );

  return (
    <div style={styles.adminBody}>
      <div style={styles.header}>
        <h1>COMMAND CENTER</h1>
        <Link to="/add-class" style={styles.addClassBtn}>+ CREATE NEW</Link>
      </div>

      <div style={styles.gridContainer}>
        {/* ဆရာနာမည်နှင့် အချက်အလက်များ ထည့်သွင်းရန် Form */}
        <section style={styles.section}>
          <h3 style={{color: '#86efac'}}>MANAGE COURSE INTEL</h3>
          <form onSubmit={handleUpdate} style={styles.form}>
            <label style={{fontSize: '12px'}}>SELECT COURSE:</label>
            <select value={courseKey} onChange={e => setCourseKey(e.target.value)} style={styles.input}>
              <option value="cyber">Cyber Security</option>
              <option value="linux">Linux Administrator</option>
              <option value="hacking">World Hacking</option>
            </select>

            <input 
              placeholder="Instructor Name (e.g. U Mya)" 
              value={formData.instructor}
              onChange={e => setFormData({...formData, instructor: e.target.value})} 
              style={styles.input} 
              required 
            />

            <input 
              placeholder="Video ID / Schedule" 
              value={formData.videoLink}
              onChange={e => setFormData({...formData, videoLink: e.target.value})} 
              style={styles.input} 
              required 
            />

            <button type="submit" disabled={loading} style={styles.updateBtn}>
              {loading ? "SAVING..." : "UPDATE DASHBOARD"}
            </button>
          </form>
        </section>

        {/* ကျောင်းသားစာရင်းကြည့်ရန် Section */}
        <section style={styles.section}>
          <div style={styles.tabHeader}>
            <button onClick={() => setActiveTab('users')} style={activeTab === 'users' ? styles.activeTab : styles.tab}>USERS</button>
            <button onClick={() => setActiveTab('pending')} style={activeTab === 'pending' ? styles.activeTab : styles.tab}>PENDING</button>
          </div>
          <div style={styles.scrollArea}>
            {dataList.map((item, idx) => (
              <div key={item.id} style={styles.card}>
                <span>{idx + 1}. {item.get('username') || item.get('studentName')}</span>
                <span style={{fontSize: '10px', color: '#8892b0'}}>{item.get('email')}</span>
              </div>
            ))}
          </div>
          <div style={{textAlign: 'right', fontSize: '10px', marginTop: '10px'}}>Total: {dataList.length}</div>
        </section>
      </div>
    </div>
  );
};

const styles = {
  loginOverlay: { background: '#0a192f', height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', flexDirection: 'column', fontFamily: 'monospace' },
  loginInput: { margin: '15px', padding: '10px', background: '#112240', border: '1px solid #00ff41', color: '#00ff41', textAlign: 'center' },
  loginBtn: { background: '#00ff41', padding: '10px 20px', border: 'none', cursor: 'pointer', fontWeight: 'bold' },
  adminBody: { background: '#0a192f', minHeight: '100vh', color: '#00ff41', padding: '40px 5%', fontFamily: 'monospace' },
  header: { display: 'flex', justifyContent: 'space-between', borderBottom: '1px solid #112240', paddingBottom: '20px', marginBottom: '30px' },
  addClassBtn: { color: '#00ff41', border: '1px solid #00ff41', padding: '8px 15px', textDecoration: 'none', borderRadius: '4px' },
  gridContainer: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))', gap: '30px' },
  section: { background: '#112240', padding: '25px', borderRadius: '15px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  input: { padding: '12px', background: '#0a192f', border: '1px solid #233554', color: '#fff', borderRadius: '6px' },
  updateBtn: { padding: '12px', background: '#00ff41', color: '#0a192f', border: 'none', fontWeight: 'bold', cursor: 'pointer', borderRadius: '6px' },
  tabHeader: { display: 'flex', gap: '15px', borderBottom: '1px solid #233554', marginBottom: '15px' },
  tab: { background: 'transparent', border: 'none', color: '#444', cursor: 'pointer', padding: '10px' },
  activeTab: { background: 'transparent', border: 'none', color: '#00ff41', cursor: 'pointer', padding: '10px', borderBottom: '2px solid #00ff41' },
  scrollArea: { maxHeight: '400px', overflowY: 'auto' },
  card: { background: '#0a192f', padding: '12px', marginBottom: '8px', borderRadius: '8px', display: 'flex', justifyContent: 'space-between', alignItems: 'center', borderLeft: '4px solid #00ff41' }
};

export default Admin;
